PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE d1_migrations(
		id         INTEGER PRIMARY KEY AUTOINCREMENT,
		name       TEXT UNIQUE,
		applied_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL
);
CREATE TABLE IF NOT EXISTS "cars" (
    id INTEGER PRIMARY KEY,
    make TEXT NOT NULL,
    model TEXT NOT NULL,
    color TEXT NOT NULL,
    license_plate TEXT NOT NULL,
    status TEXT NOT NULL DEFAULT 'PRE_ARRIVAL' CHECK (status IN ('PRE_ARRIVAL', 'REGISTERED', 'ON_DECK', 'DONE', 'PICKED_UP')),
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    registered_at DATETIME,
    on_deck_at DATETIME,
    completed_at DATETIME,
    picked_up_at DATETIME
);
CREATE TABLE status_history (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    car_id INTEGER NOT NULL,
    previous_status TEXT,
    new_status TEXT NOT NULL,
    changed_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (car_id) REFERENCES cars(id) ON DELETE CASCADE
);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_cars_status ON cars(status);
CREATE INDEX idx_cars_license_plate ON cars(license_plate);
CREATE INDEX idx_status_history_car_id ON status_history(car_id);
CREATE INDEX idx_status_history_changed_at ON status_history(changed_at);
CREATE INDEX idx_status_history_new_status ON status_history(new_status);
CREATE INDEX idx_status_history_car_status ON status_history(car_id, new_status);
